import ReactDOM from 'react-dom';
import App from './components/App';
import firebase from './fbase.js';
import AppRouter from './components/AppRouter'


ReactDOM.render(
  <React.StrictMode>
    <App />
    <AppRouter />
  </React.StrictMode>,
  document.getElementById('root')
);
